import React from "react";
import logo from './../../logo.svg';
//import PropTypes from 'prop-types';

//Style Of Component
import './homepage.scss';

const HomePage = () => {

    const goList = () => {
        console.log( "eccolo che funziona" )
    } 

    return(
        <div className="todolist-homepage">
            <div className="text-container">
                <label className="text-title">Ciao benvenuta francesca ecco la lista delle cose da fare</label>
                <div className="content-subtitle" >
                    <label className="text-subtitle"> clicca sulla icona per entrare </label>
                    <button className="button-subtitle" onClick={ ()=>goList() }   />
                </div>
            </div>
            <img src={logo} className="App-logo" alt="logo" />
        </div>
    )
}

HomePage.propTypes = { 
}; 

